import React from 'react';
import ProgressBar from './ProgressBar';

class Progress extends React.Component {
    constructor(props) {
        super(props);
    
        this.state = {
             percentage: 20
        }
    }

    render() {    
        return (
            <div className="progress-div">
                <div className="progress-div-2">
                    <ProgressBar /> 
                </div>
                
            </div>
        );
    }
}

export default Progress;
